content:
#CollierCounty will receive more than $74 million in funding through the American Rescue Plan (Coronavirus Local Fiscal Recovery Fund) to provide support in responding to the economic and public impacts of COVID-19. The intent of this funding is to help turn the tide on the pandemic, address its economic fallout and lay the foundation for a strong and equitable recovery. There are five ways that Collier County can use these funds:

‚Ä¢ Support public health response;
‚Ä¢ Address negative economic impacts;
‚Ä¢ Replace public sector revenue loss;
‚Ä¢ Premium pay for essential workers; and,
‚Ä¢ Water, sewer and broadband infrastructure.

We want your input on the programs identified for these funds! Visit the survey here: https://www.surveymonkey.com/r/CollierARP

Survey closes at 9 AM on Friday, August 20th.

